import net.sf.json.groovy.*
import com.eviware.soapui.impl.wsdl.teststeps.*
import com.eviware.soapui.support.types.StringToStringsMap

import com.eviware.soapui.impl.wsdl.support.http.HttpClientSupport
import org.apache.http.impl.cookie.BasicClientCookie

final osbCallPath = "/clientManagementOSB/subscriptions/{SUBKEY}/routes/{InService}/{InOperation}"
final soapSoapCallPath = "/clientManagementOSB/SubscriptionsService"

def groovyUtils = new com.eviware.soapui.support.GroovyUtils( context );
def authTestCase = project.testSuites["AuthSetup"].testCases["AuthSetup"];
def authTestStep = project.testSuites["AuthSetup"].testCases["AuthSetup"].testSteps["GetAccessToken"];
def formAuthTestStep = project.testSuites["AuthSetup"].testCases["AuthSetup"].testSteps["FormAuthGetCookie"];

testRunner = new com.eviware.soapui.impl.wsdl.testcase.WsdlTestCaseRunner(authTestCase, null);
testStepContext = new com.eviware.soapui.impl.wsdl.testcase.WsdlTestRunContext(authTestStep);
testStepContext = new com.eviware.soapui.impl.wsdl.testcase.WsdlTestRunContext(formAuthTestStep);
authTestStep.run(testRunner, testStepContext);
formAuthTestStep.run(testRunner, testStepContext);


def token = project.testSuites["AuthSetup"].testCases["AuthSetup"].testSteps["GetAccessToken"].getTestRequest().getResponseContentAsString();
def jsonSlurper = new JsonSlurper().parseText(token);
auth_token = jsonSlurper.access_token;

def cookie = project.testSuites["AuthSetup"].testCases["AuthSetup"].testSteps["FormAuthGetCookie"].testRequest.getResponse().getResponseHeaders()["Set-Cookie"];

for( testSuite in project.getTestSuiteList() ) {
	if (testSuite.name == "AuthSetup") {		
		continue;
	}

	for( testCase in testSuite.getTestCaseList() ) {

		if (testCase.name == "CreateClientProcess") {

		for( testStep in testCase.getTestStepList() ) {

			def headers = new StringToStringsMap()

			if( testStep instanceof RestTestRequestStep ) {



				if (testStep.getHttpRequest().getPath() == osbCallPath && testStep.getHttpRequest().getMethod().toString() == "GET") {
					testStep.getHttpRequest().setEndpoint("https://den00ohf.us.oracle.com:7094")					
					headers.put("Authorization", "Bearer " + auth_token);
				}

				else if (testStep.getHttpRequest().getPath() == soapSoapCallPath ) {
					testStep.getHttpRequest().setEndpoint("https://den00ohf.us.oracle.com:7094")
					log.info(testStep.getHttpRequest().getPath());
				}

				else {					
					testStep.getHttpRequest().setEndpoint("https://den00ohf.us.oracle.com:7095")					
					headers.put("Cookie", cookie);
				}

				testStep.getTestRequest().setRequestHeaders(headers)
	    		}
    		}


	}
}
}
